var result = final.map(colorPalette => ({
  id : colorPalette.id,
  c1 : colorPalette.code.substring(0,6),
  c2 : colorPalette.code.substring(6,12),
  c3 : colorPalette.code.substring(12,18),
  c4 : colorPalette.code.substring(18,24),
  date : colorPalette.date,
  likes : colorPalette.likes
}));

module.exports = () => {
  return result
};
